            query:(data)=>({
                url:`${USER_URL}/login`,
                method : 'POST',
                body :data,
            }),


        }),
        login:builder.mutation({
            query:(data)=>({
                url:`${USER_URL}`,
                method : 'POST',
                body :data,
            }),


        }),
        logout:builder.mutation({
            query:()=>({
                url:`${USER_URL}/logout`,
                method : 'POST',

            }),


        }),


    })
})

export const {useLoginMutation,useLogoutMutation} = userApiSlice;
